void cordic::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"in_theta_V_V_dout\" :  \"" << in_theta_V_V_dout.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"in_theta_V_V_empty_n\" :  \"" << in_theta_V_V_empty_n.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"in_theta_V_V_read\" :  \"" << in_theta_V_V_read.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"out_s_V_V_din\" :  \"" << out_s_V_V_din.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"out_s_V_V_full_n\" :  \"" << out_s_V_V_full_n.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"out_s_V_V_write\" :  \"" << out_s_V_V_write.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"out_c_V_V_din\" :  \"" << out_c_V_V_din.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"out_c_V_V_full_n\" :  \"" << out_c_V_V_full_n.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"out_c_V_V_write\" :  \"" << out_c_V_V_write.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

